//import logo from './logo.svg';
import './App.css';
import FormsComponent from './components/2TaskForms/FormsInputs';
import FormsRFF from './components/3TaskRFF/FormRFF';
import  FirstComponent  from './components/Todo';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/task1">Task1</Link>
          </li>
          <li>
            <Link to="/task2">Task2</Link>
          </li>
          <li>
            <Link to="/task3">Task3</Link>
          </li>
        </ul>
      </nav>

      {/* A <Switch> looks through its children <Route>s and
          renders the first one that matches the current URL. */}
      <Switch>
        <Route path="/task1:1" component={FirstComponent}/>
        <Route path="/task2">
          <FormsComponent />
        </Route>
        <Route path="/task3">
          <FormsRFF />
        </Route>
      </Switch>
    </div>
  </Router>
    /////////////////
    // <div className="App">
    //   <header className="App-header">
    //     <FormsRFF/>
    //   </header>
    // </div>
  );
}

export default App;
